INSERT INTO GoFlex.dbo.Event (EventCategoryId, LocationId, OrganizerId, Name, Description, DateTime, Photo, CreateTime, IsApproved) VALUES (3, 4, N'FD89A4B6-4328-4925-A4C2-E6976C1CF430', N'Newly made EVENT', N'In computing, plain text is a loose term for data (e.g. file contents) that represent only characters of readable material but not its graphical representation nor other objects (floating-point numbers, images, etc.). It may also include a limited number of characters that control simple arrangement of text, such as spaces, line breaks, or tabulation characters (although tab characters can "mean" many different things, so are hardly "plain"). Plain text is different from formatted text, where style information is included; from structured text, where structural parts of the document such as paragraphs, sections, and the like are identified; and from binary files in which some portions must be interpreted as binary objects (encoded integers, real numbers, images, etc.).', N'2021-11-22 00:00:00.0000000', N'https://media.giphy.com/media/jTTCZumAdEj43utbnz/giphy.gif', N'2021-11-01 16:42:59.3549636', 1);
